package com.springjobs.domain;

import java.sql.Date;

public class Users {
	
	private int uno;
	private String unm;
	private String uenm;
	private String uem;
	private String upw;
	private String uco;
	private String usx;
	private String ucnf;
	private Date ubd;
	private String upho;
	private String uadr;
	private String uurl;
	private String ures;
	
		
	public Users() {
		// TODO Auto-generated constructor stub
	}


	public int getUno() {
		return uno;
	}


	public void setUno(int uno) {
		this.uno = uno;
	}


	public String getUnm() {
		return unm;
	}


	public void setUnm(String unm) {
		this.unm = unm;
	}


	public String getUenm() {
		return uenm;
	}


	public void setUenm(String uenm) {
		this.uenm = uenm;
	}


	public String getUem() {
		return uem;
	}


	public void setUem(String uem) {
		this.uem = uem;
	}


	public String getUpw() {
		return upw;
	}


	public void setUpw(String upw) {
		this.upw = upw;
	}


	public String getUco() {
		return uco;
	}


	public void setUco(String uco) {
		this.uco = uco;
	}


	public String getUsx() {
		return usx;
	}


	public void setUsx(String usx) {
		this.usx = usx;
	}


	public String getUcnf() {
		return ucnf;
	}


	public void setUcnf(String ucnf) {
		this.ucnf = ucnf;
	}


	public Date getUbd() {
		return ubd;
	}


	public void setUbd(Date ubd) {
		this.ubd = ubd;
	}


	public String getUpho() {
		return upho;
	}


	public void setUpho(String upho) {
		this.upho = upho;
	}


	public String getUadr() {
		return uadr;
	}


	public void setUadr(String uadr) {
		this.uadr = uadr;
	}


	public String getUurl() {
		return uurl;
	}


	public void setUurl(String uurl) {
		this.uurl = uurl;
	}


	public String getUres() {
		return ures;
	}


	public void setUres(String ures) {
		this.ures = ures;
	}


	@Override
	public String toString() {
		return "Users [uno=" + uno + ", unm=" + unm + ", uenm=" + uenm + ", uem=" + uem + ", upw=" + upw + ", uco="
				+ uco + ", usx=" + usx + ", ucnf=" + ucnf + ", ubd=" + ubd + ", upho=" + upho + ", uadr=" + uadr
				+ ", uurl=" + uurl + ", ures=" + ures + "]";
	}
	
	

	
} // end of class
